INSERT INTO `retreats` (`id`, `title`, `slug`, `description`, `whatsapp_channel_link`, `short_description`, `start_date`, `end_date`, `timings`, `seats`, `criteria`, `special_remarks`, `instructions`, `is_featured`, `is_active`, `created_by`, `updated_by`, `created_at`, `updated_at`, `deleted_at`) VALUES
(1, 'Bible Study Crash Course', 'bible-study-crash-course-2025-11-25', '<p>The Bible study crash course will be conducted under the guidance of Fr. Daniel Poovannathil, from Thursday 1st January to Saturday 10th January 2026&nbsp;(10 days).</p>', 'https://chat.whatsapp.com/LHJ0A6OjfFVCaDO4Z0OKY7', NULL, '2026-01-01', '2026-01-10', '9:00 AM - 9:00 PM', 200, 1, NULL, '<p><strong>Guidelines for the participants of Bible Study Course.</strong></p><p>* It is compulsory for you to stay at the retreat centre for the full two weeks.</p><p> <strong>Please note: accommodation will be available only from 1 January. Early check-in cannot be provided due to other scheduled events.</strong></p><p>* The registration will start at 1 pm on 01/01/2026</p><p>* An original ID proof with photo is required for the registration.</p><p>* The course will start at 4:00 pm on Thursday with Rosary followed by the celebration of Holy Eucharist.</p><p>* The participants are requested to make your confession prior if possible.</p><p>* We humbly request your valuable prayer for Fr.Daniel Poovannathil and the MCRC team members</p><p>* All the participants must bring your personal Holy Bible.&nbsp;</p><p>* Do not forget to read the below given Bible parts before joining on 01/01/2026</p><ol><li>Genesis&nbsp;</li><li>Exodus&nbsp;</li><li>Numbers&nbsp;</li><li>Joshua&nbsp;</li><li>Judges&nbsp;</li><li>1,2 Samuel&nbsp;</li><li>1,2 Kings&nbsp;</li><li>Ezra</li><li>Nehemiah&nbsp;</li><li>1,2 Maccabees&nbsp;</li><li>Luke&nbsp;</li><li>Acts</li></ol><p>* The participants are also requested to bring a&nbsp;note book,pen, bedsheet, needed medications and other personal belongings.</p><p>* No registration fee for the Bible crash course&nbsp;</p><p>* The participants will be accommodated in dormitories unless you take a room. We have&nbsp;a limited number of private rooms and each one rents 500 per day. Kindly carry a photo attached ID proof if you are intended to take room. No advance booking for rooms.</p><p>* Every one must bring a copy of their photo attached ID proof.</p><p>* Mobile phone use is strictly limited within the campus. You can use it only in allotted time.</p><p>* We will not encourage you to distract the course by allowing you to go back before&nbsp;10/01/2026.Hence, kindly arrange return tickets ( bus , train etc) after 10 am on 10/01/2026 .</p><p>* Facilities are available to store medicines like insulin in the refrigerator.&nbsp;</p><p>* we do provide laundry facilities at the retreat centre.</p><p>* Remember, do not take part in the residential course if you are on any kind of psychiatric prescriptions.</p><p><br></p><p>With Prayers,</p><p>Fr.Daniel Poovannathil</p><p>Director, Mount Carmel Retreat Centre</p><p>Trivandrum</p>', 1, 1, 1, 1, '2025-11-13 05:17:43', '2025-11-24 19:42:57', NULL),
(2, 'Priest Retreat¬†(English)', 'priest-retreat-english-2025-11-24', '<p>The retreat for priests will begin on Sunday, January 11 at 10:00 AM and conclude on Thursday, January 15 at 9:00 AM.</p>', 'https://chat.whatsapp.com/GuxRugBTppnANFULyNAHhR', NULL, '2026-01-11', '2026-01-15', '9:00 AM - 9:00 PM', 300, 2, NULL, '<p>* Registration will begin at 9:00 AM on Sunday, January 11.</p><p>* There is no registration fee for the retreat. However, voluntary donations inspired by the Holy Spirit are welcome.</p><p>* Only those who can attend the retreat from beginning to end should register.</p><p>* No one will be allowed to leave before 9:00 AM on Thursday. Therefore, participants are kindly requested to arrange their return travel (train or bus) only after 10:00 AM on January 15.</p><p>* Those who have the opportunity to go for confession before the retreat are encouraged to do so and come prepared with personal prayer.</p><p>* Participants are requested to pray for Rev. Fr. Daniel Poovannathil, who will be leading the retreat, and for the MCRC team members.</p><p>* Please bring the following items when attending the retreat:</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Bible</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Notebook</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Pen</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Bed sheet</p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;* Other personal items</p><p>* The retreat center primarily offers dormitory accommodation. Those who require a private room must pay a separate rental fee. Room allocation will be done at the time of registration for those who request it (‚Çπ500 per day). Rooms with attached bathrooms are limited to single occupancy. The room rent can be paid upon arrival.</p><p>* All participants must bring a photo ID proof.</p><p>* Mobile phones must be handed over at the reception counter during registration. Keeping mobile phones during the retreat is not permitted. Phones will be returned on Thursday at 9:00 AM.</p><p>* There are no facilities for washing clothes at the retreat center.</p><p>* A refrigerator is available for storing medications like insulin. Please remember to bring any regular medications you may need.</p><p><br></p><p><em>With prayers,</em></p><p><em>Fr. Daniel Poovannathil</em></p><p><em>Director, MCRC, Thiruvananthapuram</em></p>', 0, 1, 1, 1, '2025-11-17 06:59:59', '2025-11-23 13:26:39', NULL);
